import { TextStyle, Page, Layout, EmptyState, FooterHelp, Link, Card, Stack } from '@shopify/polaris';
import { TitleBar, ResourcePicker } from '@shopify/app-bridge-react';
import { useState } from 'react';

const register = () => {
    return(
            <Page fullWidth={true}>
                <Layout>
                    <Card>
                        <Stack>
                            <h1>Registro</h1>
                        </Stack>
                    </Card>
                </Layout>
            </Page>
    );
};
export default register;
